(function() {
var frigYear = data('year_installed');
if (data('year_installed') === null || data('year_installed') === undefined || data('year_installed') <= 0) { return 0; }
var currYear = new Date().getFullYear();
var years = Math.abs(currYear - frigYear);
return years;})()

